create table MOCK_DATA (
	id int identity,
	Nombres VARCHAR(50),
	ApellidoPaterno VARCHAR(50),
	ApellidoMaterno VARCHAR(50),
	FechaNacimiento DATE,
	gender VARCHAR(50),
	dni INT,
	city VARCHAR(50),
	country VARCHAR(50),
	street_address VARCHAR(50),
	email VARCHAR(50),
	phone_number VARCHAR(50)
)












SELECT LEFT(REPLACE(DNI, '-',''),8),	Nombres,	ApellidoPaterno	,ApellidoMaterno,gender,FechaNacimiento
FROM MOCK_DATA
WHERE ID BETWEEN 1 AND 900



SELECT LEFT(REPLACE(DNI, '-',''),8),	Nombres,	ApellidoPaterno	,ApellidoMaterno,FechaNacimiento,gender, ''
FROM MOCK_DATA
WHERE ID BETWEEN 901 AND 1000